import React, { Component } from 'react'

export default class NavBar extends Component {
    render() {
        return (
            <div className="app-nav-bar">
                <div className="app-nav-bar-items">
                <ul>
                    <li>Help</li>
                    <li>About</li>
                    <li>Subscribe</li>
                    <li>Sign up</li>
                </ul>
                </div>
            </div>
        )
    }
}
